CREATE TABLE IF NOT EXISTS `travel_system`.`road_path_points`(
    `id` bigint NOT NULL AUTO_INCREMENT,
    `road_id` int NOT NULL,
    `latitude` double NOT NULL,
    `longitude` double NOT NULL,
    `sequence_number` int NOT NULL,
    `created_at` timestamp NULL DEFAULT (CURRENT_TIMESTAMP),
    `updated_at` timestamp NULL DEFAULT (CURRENT_TIMESTAMP) ON UPDATE CURRENT_TIMESTAMP,
    PRIMARY KEY  (`id` ),
    KEY `fk_road_path_points_road` (`road_id` ),
    CONSTRAINT `fk_road_path_points_road` FOREIGN KEY (`road_id`) REFERENCES `travel_system`.`road_connections` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci ;





